import React, { Component } from 'react'
import PageWrapper from '../../layouts/pageWrapper'
import UICard from './UiCard';


const data = [
    {id: 0, name: "Kristean", date: 2010, desc: "Kristy is an art director living in New York.", followers: 22},
    {id: 1, name: "Kristean", date: 2010, desc: "Kristy is an art director living in New York.", followers: 22},
    {id: 2, name: "Kristean", date: 2010, desc: "Kristy is an art director living in New York.", followers: 22},
    {id: 3, name: "Kristean", date: 2010, desc: "Kristy is an art director living in New York.", followers: 22},
    {id: 4, name: "Kristean", date: 2010, desc: "Kristy is an art director living in New York.", followers: 22},]

export default class Main extends Component {
  
    render() {
        const { match } = this.props;
        return (
            <PageWrapper match={match} >
                <div className="ui raised very padded text container segment">
                   {
                       data.map(i=>{
                           return(
                               <UICard name={i.name}  />
                           )
                       })
                   }
                </div>
            </PageWrapper>
        )
    }
}
